// IREO Crowdsale controller
pragma solidity ^0.4.4;
import './bancor/interfaces/ISmartToken.sol';
import './bancor/Utils.sol';
import '../Trusteed.sol';
import { LiquidRE } from './LiquidRE.sol';

contract IREO is Trusteed {

    ISmartToken public token;
    bool public status = false;                // pending by default
    uint256 public startTime = 0;       // IREO start time (in seconds)
    uint256 public endTime = 0;         // IREO end time (in seconds)
    uint256 public fundingGoal = 0;
    uint256 public amountRaised = 0;
    uint256 public amountWithdrawn = 0;
    uint256 public price = 0;
    mapping(address => uint256) public contributions;
    bool fundingGoalReached = false;
    bool crowdsaleClosed = false;
    bool public trusteeWithdraw = false;

    address public LiquidREAdmin = 0x0;
    address public entity = 0x0;

    event GoalReached(address indexed trustee, uint256 amount);
    event Contribution(address indexed contributor, uint256 amount, uint256 tokenAmount);

    function IREO(
        address _entity,
        address _trustee,
        uint256 _startTime,
        uint256 _endTime,
        uint256 _goal,
        uint256 _price,
        ISmartToken _token
    )
        public
        Trusteed(_trustee)
    {
        entity = _entity;
        startTime = _startTime;
        endTime = _endTime;
        fundingGoal = _goal; // wei
        price = _price; // wei
        LiquidREAdmin = msg.sender;
        token = _token;
    }

    modifier approved() {
        require(status);
        _;
    }

    modifier crowdsaleOngoing() {
        require(now >= startTime && now < endTime);
        _;
    }

    modifier crowdsaleEnd() {
        require(now >= endTime || amountRaised >= fundingGoal);
        _;
    }

    modifier trusteeOwnerOnly()
    {
        address _trustee = senderTrustee();
        require(_trustee == trustee);
        _;
    }

    /**
     * should be removed for the purpose of testing
     */
    function makeCrowdsaleEnd()
        public
    {
        endTime = 0;
    }

    function senderTrustee()
        private
        view
        returns (address)
    {
        LiquidRE liquidRE = LiquidRE(LiquidREAdmin);
        address _trustee = liquidRE.addressTrustee(msg.sender);
        return _trustee;
    }

    function updateStatus(bool _status)
        public
        trusteeOwnerOnly
    {
        status = _status;
    }

    function contribute()
        public
        approved
        crowdsaleOngoing
        payable
        returns (uint256)
    {
        return processContribution();
    }

    function processContribution()
        private
        returns (uint256)
    {
        require(!crowdsaleClosed);
        uint amount = msg.value;
        contributions[msg.sender] += amount;
        uint returnAmount = 0;

        // check if amount puts it over funding goal
        if (amountRaised + amount > fundingGoal) {
            returnAmount = amount - (fundingGoal - amountRaised);
            amount = fundingGoal - amountRaised;
        }

        uint tokenAmount = amount / price;
        amountRaised += amount;
        checkGoalReached();
        LiquidRE liquidRE = LiquidRE(LiquidREAdmin);
        liquidRE.sendIREOToken(token, tokenAmount, msg.sender);
        Contribution(msg.sender, msg.value, tokenAmount);

        // return any leftovers that would've put it over funding goal
        if (returnAmount > 0) {
            msg.sender.transfer(returnAmount);
        }

        return tokenAmount;
    }

    function ()
        public
        payable
    {
        contribute();
    }

    function checkGoalReached()
        public
    {
        if(amountRaised >= fundingGoal) {
            fundingGoalReached = true;
            crowdsaleClosed = true;
            GoalReached(trustee, amountRaised);
        }
    }

    function checkCrowdsaleStatus()
        public
    {
        if(now >= endTime) {
            crowdsaleClosed = true;
        }
    }

    function withdraw()
        public
        crowdsaleEnd
    {
        address sender = senderTrustee();
        if(sender == trustee) {
            if(amountRaised > 0 && amountRaised >= fundingGoal) {
                trusteeWithdraw = true;
                trustee.transfer(amountRaised);
            }
        } else {
            if(amountRaised > 0 && !fundingGoalReached) {
                if(contributions[msg.sender] > 0) {
                    amountWithdrawn += contributions[msg.sender];
                    contributions[msg.sender] = 0;
                    msg.sender.transfer(contributions[msg.sender]);
                }
            }
        }
    }

}
